import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";

import Icone from "../Configs/Icone";
import PageCurriculo from "../Pages/PageCurriculo";
import PageHome from "../Pages/PageHome";
import PageQuemsomos from "../Pages/PageQuemsomos";
import PageVagas from "../Pages/PageVagas";
import PageAgenda from "../Pages/PageAgenda";
import PageCardapio from "../Pages/PageCardapio";
import PageEvento from "../Pages/PageEvento";
import PageNovidades from "../Pages/PageNovidades";

const Tab = createBottomTabNavigator();
export default () => {
  return (
    <Tab.Navigator
      screenOptions={({ route }) => ({
        tabBarIcon: ({ focused, color, size }) => {
          let icone;

          if (route.name === "TabHome") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="home" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="home" />
            );
          } else if (route.name === "TabAgenda") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="calendar" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="calendar" />
            );
          } else if (route.name === "TabCardapio") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="utensilst" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="pepper-hot" />
            );
          } else if (route.name === "TabEventos") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="address-book" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="address-book" />
            );
          } else if (route.name === "TabNovidades") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="address-book" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="address-book" />
            );
          }

          // You can return any component that you like here!
          return icone;
        },
        tabBarActiveTintColor: "tomato",
        tabBarInactiveTintColor: "gray",
      })}
    >
      <Tab.Screen
        name="TabHome"
        component={PageHome}
        options={() => ({ title: "Home", headerShown: false })}
      />
      <Tab.Screen
        name="TabAgenda"
        component={PageAgenda}
        options={() => ({ title: "Agenda ", headerShown: false })}
      />
      <Tab.Screen
        name="TabCardapio"
        component={PageCardapio}
        options={() => ({ title: "Card√°pio", headerShown: false })}
      />
      <Tab.Screen
        name="TabEventos"
        component={PageEvento}
        options={() => ({ title: "Eventos", headerShown: false })}
      />
      <Tab.Screen
        name="TabNovidades"
        component={PageNovidades}
        options={() => ({ title: "Novidades", headerShown: false })}
      />
    </Tab.Navigator>
  );
};
